<div class="toast" id="toast">Logbook opened in a new tab.</div>
<script>
const canvas=document.getElementById('snow'); const ctx=canvas.getContext('2d');
function sizeCanvas(){ const rect=canvas.getBoundingClientRect(); const dpr=Math.max(1,Math.floor(window.devicePixelRatio||1)); canvas.width=Math.round(rect.width*dpr); canvas.height=Math.round(rect.height*dpr); }
function drawSnow(){ const w=canvas.width,h=canvas.height; if(!w||!h)return; const img=ctx.createImageData(w,h); const data=img.data; for(let i=0;i<data.length;i+=4){ const v=Math.random()*255; data[i]=data[i+1]=data[i+2]=v; data[i+3]=255; } ctx.putImageData(img,0,0); }
function resizeAll(){ sizeCanvas(); drawSnow(); }
const ro=new ResizeObserver(resizeAll); ro.observe(canvas.parentElement); addEventListener('resize',resizeAll); resizeAll(); setInterval(drawSnow,60);

const needle=document.getElementById('needle'),readout=document.getElementById('readout'),statusEl=document.getElementById('status'),led=document.getElementById('led'),playBtn=document.getElementById('playBtn'),replayBtn=document.getElementById('replayBtn'),hintBtn=document.getElementById('hintBtn'),hintEl=document.getElementById('hint'),audio=document.getElementById('morseAudio'),stationEl=document.getElementById('station');
const TUNING_MS=2000;
const stationSequence=[{name:"KQX-112",at:600},{name:"W9XYZ",at:1300},{name:"AD8AJ",at:TUNING_MS+500}];
async function requestFullscreen(){try{const el=document.documentElement;if(el.requestFullscreen){await el.requestFullscreen();}else if(el.webkitRequestFullscreen){el.webkitRequestFullscreen();}}catch(e){}}
function setNeedle(p){const w=document.querySelector('.dial').clientWidth;const x=Math.max(0,Math.min(w-2,p*(w-2)));needle.style.transform=`translateX(${x}px)`;}
function animateTune(){setNeedle(0.05);setTimeout(()=>setNeedle(0.35),450);setTimeout(()=>setNeedle(0.62),900);setTimeout(()=>setNeedle(0.88),1400);setTimeout(()=>setNeedle(0.67),1750);}
function scheduleStations(){stationEl.textContent="—";stationSequence.forEach(s=>{setTimeout(()=>{stationEl.textContent=s.name;},s.at);});}
function playSequence(){playBtn.disabled=true;statusEl.textContent="Tuning…";led.style.background="#22ffdd";animateTune();scheduleStations();readout.textContent="— Searching bands —";
setTimeout(()=>{readout.textContent="— Signal lock —";statusEl.textContent="Receiving Morse…";audio.currentTime=0;audio.play().then(()=>{
  audio.onended=()=>{statusEl.textContent="Transmission lost.";replayBtn.disabled=false;playBtn.disabled=false;led.style.background="#032c28";
    const hintMsg=document.createElement("div");hintMsg.style.marginTop="18px";hintMsg.style.padding="10px";hintMsg.style.borderTop="1px solid rgba(32,255,227,0.3)";hintMsg.style.color="#7bd4c9";hintMsg.style.fontFamily="ui-monospace, SFMono-Regular, Menlo, Consolas, monospace";hintMsg.style.fontSize="0.9rem";hintMsg.style.textAlign="center";hintMsg.style.opacity="0.85";hintMsg.innerHTML="<em>Among the trees, the signal hums quietly.<br>Not all transmitters broadcast. Some wait to be awakened.</em>";statusEl.parentElement.appendChild(hintMsg);};
}).catch(()=>{statusEl.textContent="Audio blocked, tap again.";playBtn.disabled=false;led.style.background="#ff5d73";});},TUNING_MS+450);}
playBtn.addEventListener('click',async()=>{await requestFullscreen();playSequence();});
replayBtn.addEventListener('click',()=>{audio.currentTime=0;audio.play();statusEl.textContent="Replaying…";});
hintBtn.addEventListener('click',()=>{hintEl.style.display=hintEl.style.display==='block'?'none':'block';hintBtn.textContent=hintEl.style.display==='block'?'Hide Hint':'Show Hint';});

// "Logged!" toast when clicking Log button
const toast=document.getElementById('toast'); document.getElementById('logBtn').addEventListener('click',()=>{ toast.classList.add('show'); setTimeout(()=>toast.classList.remove('show'), 2200); });
</script>
</body>
</html>
